import './App.css';

const particlesOptions ={
            particles: {
             line_linked: {
              shadow: {
              enable: true,
              color: "#3CA9D1",
              blur: 5
                    }
                  }
                }



}
function App() {
  return (
    <div className="App">

        <Particles className ='particles'
              params={particlesOptions} 


            />

      <Navigation />
      <Logo />
      <Rank />
      <ImageLinkForm />


          {/*<FaceRecognition />*/ }

    </div>
  );
}

export default App;
